	private final Grammar grammar;
	
	private final TerminalsGrammarAccess gaTerminals;

	@Inject
	public SvgPaintGrammarAccess(GrammarProvider grammarProvider,
			TerminalsGrammarAccess gaTerminals) {
		this.grammar = internalFindGrammar(grammarProvider);
		this.gaTerminals = gaTerminals;
		this.pPaint = new PaintElements();
		this.pNonePaint = new NonePaintElements();
		this.pColor = new ColorElements();
		this.pHexColor = new HexColorElements();
		this.tHEX = (TerminalRule) GrammarUtil.findRuleForName(getGrammar(), "org.xtext.svg.paint.SvgPaint.HEX");
		this.pRgbColor = new RgbColorElements();
		this.tRGB_NUMBER = (TerminalRule) GrammarUtil.findRuleForName(getGrammar(), "org.xtext.svg.paint.SvgPaint.RGB_NUMBER");
		this.pRgbPercentage = new RgbPercentageElements();
		this.tRGB_PERCENTAGE = (TerminalRule) GrammarUtil.findRuleForName(getGrammar(), "org.xtext.svg.paint.SvgPaint.RGB_PERCENTAGE");
		this.pKeywordColor = new KeywordColorElements();
		this.eColorKeyword = new ColorKeywordElements();
		this.pIriPaint = new IriPaintElements();
		this.pLocalIri = new LocalIriElements();
	}
	
	protected Grammar internalFindGrammar(GrammarProvider grammarProvider) {
		Grammar grammar = grammarProvider.getGrammar(this);
		while (grammar != null) {
			if ("org.xtext.svg.paint.SvgPaint".equals(grammar.getName())) {
				return grammar;
			}
			List<Grammar> grammars = grammar.getUsedGrammars();
			if (!grammars.isEmpty()) {
				grammar = grammars.iterator().next();
			} else {
				return null;
			}
		}
		return grammar;
	}
	
	@Override
	public Grammar getGrammar() {
		return grammar;
	}
	
	
